import { Component } from '@angular/core';

interface Car {
  id: number;
  vehicle: string;
  licensePlate: string;
  owner: string;
  entryTime: string;
}

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'EstacionaCar';
  garage: Car[] = [];
  vehicle = '';
  licensePlate = '';
  owner = '';

  constructor() {
    const savedGarage = localStorage.getItem('garage');
    if (savedGarage) {
      this.garage = JSON.parse(savedGarage);
    }
  }

  registerCar() {
    if (this.vehicle && this.licensePlate && this.owner) {
      const newCar: Car = {
        id: this.generateId(),
        vehicle: this.vehicle,
        licensePlate: this.licensePlate,
        owner: this.owner,
        entryTime: this.getCurrentTime()
      };
      this.garage.push(newCar);
      this.saveGarage();
      this.clearForm();
    }
  }

  generateId(): number {
    return this.garage.length > 0 ? this.garage[this.garage.length - 1].id + 1 : 1;
  }

  getCurrentTime(): string {
    const now = new Date();
    return now.toISOString();
  }

  clearForm() {
    this.vehicle = '';
    this.licensePlate = '';
    this.owner = '';
  }

  deleteCar(id: number) {
    const confirmDelete = confirm('Tem certeza de que deseja excluir este carro?');
    if (confirmDelete) {
      this.garage = this.garage.filter(car => car.id !== id);
      this.saveGarage();
    }
  }

  calculateDuration(entryTime: string): string {
    const entry = new Date(entryTime);
    const now = new Date();
    const diff = Math.abs(now.getTime() - entry.getTime());
    const hours = Math.floor(diff / (1000 * 60 * 60));
    const minutes = Math.floor((diff % (1000 * 60 * 60)) / (1000 * 60));
    return `${hours}h ${minutes}min`;
  }

  saveGarage() {
    localStorage.setItem('garage', JSON.stringify(this.garage));
  }

  showHistory() {
    // Implemente a lógica para mostrar o histórico usando as rotas do Angular
  }

  editCar(id: number) {
    // Implemente a lógica de edição aqui
  }
}
<h1>EstacionaCar</h1>

<form>
  <label for="vehicle">Veículo:</label>
  <input type="text" id="vehicle" [(ngModel)]="vehicle">

  <label for="licensePlate">Placa:</label>
  <input type="text" id="licensePlate" [(ngModel)]="licensePlate">

  <label for="owner">Proprietário:</label>
  <input type="text" id="owner" [(ngModel)]="owner">

  <button (click)="registerCar()">Registrar</button>
</form>

<hr>

<h2>Histórico</h2>

<table>
  <thead>
    <tr>
      <th>Veículo</th>
      <th>Placa</th>
      <th>Proprietário</th>
      <th>Entrada</th>
      <th>Duração</th>
      <th>Ações</th>
    </tr>
  </thead>
  <tbody>
    <tr *ngFor="let car of garage">
      <td>{{ car.vehicle }}</td>
      <td>{{ car.licensePlate }}</td>
      <td>{{ car.owner }}</td>
      <td>{{ car.entryTime }}</td>
      <td>{{ calculateDuration(car.entryTime) }}</td>
      <td>
        <button (click)="editCar(car.id)">Editar</button>
        <button (click)="deleteCar(car.id)">Excluir</button>
      </td>
    </tr>
  </tbody>
</table>

<hr>

<button (click)="showHistory()">Exibir Histórico</button>
